import React from 'react'
import ReactPlayer from 'react-player';
function Feed() {
  return (
    <div className = 'flex justify-center items-center'>
        <ReactPlayer width='100%'
          height='100%' url="http://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ElephantsDream.mp4" controls={true}></ReactPlayer>
    </div>
  )
}

export default Feed
